import React, { Component } from 'react';

class MainInfo extends Component{
  constructor(props) {
    super(props)
  }

  render() {
    return(
      <div>
        <article className='home-div'>
          <h1>Name Lastname</h1>
          Landing page
        </article>
        <article className='about-div'>
          <h1>About</h1>
          Basic information
        </article>
        <article className='about-div'>
          <h1>Projects</h1>
          Github links
        </article>
      </div>
    )


  }
}

export default MainInfo;
